    "2016-07-27T22:19:25.884789",nt"name": "invasive-species",nt"isopen":
    false,nt"url": null,nt"notes": "This is a summary of management activities
    and research related to invasive species on Neal Smith National Wildlife Refuge
    between 1992 and 2009.  As part of the Refugeu2019s prairie restoration goals, invasive
    plant species such as Canada thistle, sweet clover, black locust, Rubus parvifolius,
    and lespedeza are being eradicated.  Removal methods consist of herbicide use, prescribed
    burns, and mowing.  This document provides a summary of invasive species management
    activities for each year.",nt"license_title": "License Not Specified",nt"extras":
